import React from "react";
import SvgIcon from '@mui/material/SvgIcon';
import Googleicon from '../../images/googlemap.png';
import GoogleiconChecked from '../../images/hotpepper.png';

export function GoogleIcon (props) {
  return (
    <SvgIcon
      component="span"
      sx={{transform: 'scale(2)'}}>

      {props.checked ? 
        <img src={Googleicon} width="24" height="24"></img> 
        :
        <img src={GoogleiconChecked} width="24" height="24"></img>
      }

    </SvgIcon>
  );
};
